import { useState } from "react";
import { Container, Row, Col } from "react-bootstrap";
import contactImg from "../assets/img/contact-img.svg";
import 'animate.css'


export const Contact = () => {
  const contacts = [
    { email: "nicolasRod09.dev@gmail.com", 
    phone: "+55 (31) 97213-4707" },
  ];

  return (
    <section className="contact-list">
      <h2>Contact List</h2>
            <p>
              <strong>
                Email:
              </strong>
              {contacts.email}
            </p>
            <p>
              <strong>Phone:</strong>{" "}
              {contacts.phone}
            </p>
    </section>
  );
}
